{"id": 67, "url": "https://www.apartmentfinder.com/California/Oakland-Apartments/The-Landing-At-Jack-London-Square-Apartments", "title": "The Landing at Jack London Square Apartments", "location": "101-141 Embarcadero, Oakland, CA  94607", "rent_special": "Save up to 25% each month on a 6-month lease or up to 20% each month on a 12-month lease. Valid on select homes for new applicants w/ approved credit. Subject to availability. Move-in date conditions apply. Exp. 10/28/20", "price_range": "$2,174 - $3,449", "beds": "Studio - 2", "bath": "1 - 2", "lease_term": "We have flexible lease terms and pricing to fit your needs!", "assigned_garage_parking_price": "", "assigned_other_parking_price": "", "cat_rent": "$50", "dog_rent": "$75", "application_fee": "$48", "cat_deposit": "$500", "dog_deposit": "$500", "apartment_description": "Discover relaxed, modern living amid a lush landscape with sweeping Bay views at The Landing at Jack London Square in Oakland, CA. Each of our apartment homes for rent is designed in modern style and features a combination of hardwood-style vinyl flooring and carpet, quartz countertops, stainless steel appliances, and your own private patio or balcony. Additional conveniences include spacious storage closets and an in-home washer and dryer and select homes also include a fireplace. With our offering of studio, 1-, and 2-bedroom floor plans, we\u2019re sure to have the right one for you.\u00a0 Around our pet-friendly community, enjoy amenities including a spacious clubhouse and business center, perfect lounging or working from home. Skip the gym membership and work out in our fitness center with cutting-edge Technogym equipment or relax in our year-round pool and spa. Our community is positioned right on the San Francisco Bay and offers easy access to gorgeous waterfront trails for you to enjoy. When it\u2019s time to venture beyond the neighborhood, getting around is simple. BART is less than a mile from our community, and the nearest AMTRAK station is right outside. Catch the San Francisco Bay Ferry at nearby Oakland Jack Landon Square Terminal, located less than a mile from your front door. Major interstates 880 and 980 are just a few blocks away making commuting easier than ever.", "office_hour": {"Monday": {"time_open": "9AM", "time_close": "6PM"}, "Tuesday": {"time_open": "9AM", "time_close": "6PM"}, "Wednesday": {"time_open": "10AM", "time_close": "6PM"}, "Thursday": {"time_open": "9AM", "time_close": "6PM"}, "Friday": {"time_open": "9AM", "time_close": "6PM"}, "Saturday": {"time_open": "9AM", "time_close": "6PM"}, "Sunday": {"time_open": "Closed", "time_close": ""}}, "special_features": ["ADA\u00a0features", "BBQ area", "Courtesy Patrol", "Lounge area", "Online resident portal"], "community_features": ["Wi-Fi", "Business Center", "Courtyard", "Fitness Center", "Pool"], "floorplan_amenities": ["Washer/Dryer", "Heating", "Fireplace", "Pantry", "Microwave", "Carpet", "Vinyl Flooring", "Views", "Balcony"], "parking": [], "pet_policy": "Dogs Allowed", "airport": {"Oakland International": {"drive": "14 min", "distance": "8.6 mi"}}, "universities": {"Laney College": {"drive": "4 min", "distance": "1.0 mi"}, "Lincoln University": {"drive": "4 min", "distance": "1.2 mi"}, "College of Alameda": {"drive": "7 min", "distance": "2.2 mi"}}, "park_recreation": {"Jack London Square": {"drive": "3 min", "distance": "0.5 mi"}, "Oakland Museum of California": {"drive": "3 min", "distance": "0.7 mi"}, "Juan Bautista de Anza National Historic Trail": {"drive": "3 min", "distance": "1.0 mi"}, "Lakeside Park Garden Center": {"drive": "6 min", "distance": "2.0 mi"}, "Rotary Nature Center": {"drive": "8 min", "distance": "2.4 mi"}}, "shopping_mall": {"Pacific Renaissance": {"drive": "4 min", "distance": "0.9 mi"}, "Old Oakland": {"drive": "4 min", "distance": "1.0 mi"}, "Strip Center at 393 8th St": {"drive": "3 min", "distance": "1.0 mi"}}, "military_bases": {"Oakland/US Naval Supply Center": {"drive": "7 min", "distance