{"id": 125, "url": "https://www.apartmentfinder.com/California/Oakland-Apartments/Oakland-Civic-Center-Apartments-5sf0j6q", "title": "Oakland Civic Center Apartments", "location": "392 11th St, Oakland, CA  94607", "rent_special": "", "price_range": "$2,000 - $2,500", "beds": "1", "bath": "1", "lease_term": "Contact office for Lease Terms", "assigned_garage_parking_price": "", "assigned_other_parking_price": "", "cat_rent": "", "dog_rent": "", "application_fee": "$25", "cat_deposit": "", "dog_deposit": "", "apartment_description": "Available in 2021!\n\nPrivate furnished room in a coliving community- all utilities included! Check out floorplans for different room types available!\n\nFurnished room available in a fully renovated coliving building right in the heart of Downtown Oakland.\n\nThis fresh new housing concept welcomes people from all social and cultural backgrounds to join us as we create a one-of-a-kind place to call home. If you are tired of having roommates, new to town, or just want a convenient and affordable place to live- look no further. 392 11th St. has everything you need to stay, work, and play!\n\nHow it works:\n\n*Each resident rents a fully furnished room.\n*Each suite has different bathroom configurations. Some suites have shared j & j bathrooms, private half baths, or private full baths. Inquire for details.\n*There are 5 shared kitchens and 5 shared living areas that can be accessed by all residents in the building. Each floor has a unique theme, so whether you want to lose yourself in a good book in the reading room, perfect your poker face in the game room, host a dinner party in the cook's quarters, relax and catch a flick in the lazy lounge, or root your team on to victory in the sports parlour- we've got you covered!\n*Residents will be able to enjoy a variety of amenities in the huge open concept 5,000 sq. foot basement including:\n\n*Coin-op laundry\n*Bike storage\n*Lounge area\n...and more!\n\nThis unit comes furnished with modern bed frame, mattress, nightstand, dresser, lamp, and chair.\n\nLocation, location! A 99 Walk Score and 89 Transit Score means no car necessary to run errands or commute to work. Walk to BART in 2 minutes and Lake Merritt in 11 minutes. Sip espresso at Fig & Poe- the brand new coffee shop on the 1st floor- or make reservations for delicious California fare downstairs at the restaurant (coming soon!).\n\nIf you value diversity, community, convenience, and meeting new people- this may be the living situation for you.", "office_hour": {"Monday": {"time_open": "12AM", "time_close": "12AM"}, "Tuesday": {"time_open": "12AM", "time_close": "12AM"}, "Wednesday": {"time_open": "12AM", "time_close": "12AM"}, "Thursday": {"time_open": "12AM", "time_close": "12AM"}, "Friday": {"time_open": "12AM", "time_close": "12AM"}, "Saturday": {"time_open": "12AM", "time_close": "12AM"}, "Sunday": {"time_open": "12AM", "time_close": "12AM"}}, "special_features": [], "community_features": [], "floorplan_amenities": [], "parking": [], "pet_policy": "", "airport": {"Oakland International": {"drive": "14 min", "distance": "9.1 mi"}}, "universities": {"Lincoln University": {"drive": "2 min", "distance": "0.5 mi"}, "Laney College": {"drive": "7 min", "distance": "1.3 mi"}, "Samuel Merritt University": {"drive": "6 min", "distance": "1.8 mi"}}, "park_recreation": {"Juan Bautista de Anza National Historic Trail": {"drive": "1 min", "distance": "0.3 mi"}, "Oakland Museum of California": {"drive": "2 min", "distance": "0.5 mi"}, "Jack London Square": {"drive": "3 min", "distance": "0.8 mi"}, "Lakeside Park Garden Center": {"drive": "4 min", "distance": "1.3 mi"}, "Rotary Nature Center": {"drive": "6 min", "distance": "1.6 mi"}}, "shopping_mall": {"Strip Center at 393 8th St": {"drive": "1 min", "distance": "0.3 mi"}, "Strip Center at 1127 Webster St": {"drive": "1 min", "distance": "0.3 mi"}, "Pacific Renaissance": {"drive": "2 min", "distance": "0.4 mi"}}, "military_bases": {"Oakland/US Naval Supply C